import React from 'react';

function MatchedUserCard({ user }) {
    return (
      <div className="card">
        <img className="card-img-top" src={user.img} alt={user.name} />
        <div className="card-body">
          <h3 className="card-title">{user.name}</h3>
          <p>Age: {user.age}</p>
          <p>Major: {user.major}</p>
          <p>Hobbies: {user.hobbies}</p>
          <p>Career Aspirations: {user.careerAspirations}</p>
          <div className="form-group">
            <button type="submit" className="btn btn-primary">Unmatch</button>
            <button type="submit" className="btn btn-primary">Chat</button>
          </div>
        </div>
      </div>
    );
  }

  export default MatchedUserCard;
